import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <form >
      <label>
        Essay:
        <textarea value={this.state.value} onChange={this.handleChange} />
      </label>
      <input type="submit" value="Submit" />
    </form>
  );
}

export default App;
